import React from 'react';

const SliderButton = ({ index, active, onClick }) => {
  return (
    <button
      className={`slider-button ${active ? 'active' : ''}`}
      onClick={() => onClick(index)}
    >
      {index + 1}
    </button>
  );
};

export default SliderButton;
